// user.service.ts
import { Injectable } from '@angular/core';

interface User {
  name: string;
  // other user properties...
}

@Injectable({
  providedIn: 'root',
})
export class UserService {
  private user: User | null = null;

  setUser(user: User): void {
    this.user = user;
  }

  getUser(): User | null {
    return this.user;
  }
}
